    button {
      margin: 0;
      padding: 0;
      border: 0;
      font-size: 100%;
      vertical-align: baseline;
      box-sizing: border-box;
      color: #fff
    }

    a:hover,

      opacity: .6
    }

    .dnone {
      display: none
    }

    a {

    }

    input {

    }

    }

      justify-content: center;
      align-items: center
    }

    .app {
      width: 100dvw;
      height: 100dvh;
      position: absolute
    }

    .content_wrapper {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 100dvw
    }

    body,
    html {
      overflow: hidden
    }

    .bg {
      position: absolute;
      top: 0;
      left: 0
    }

    .bg img {
      width: 101dvw;
      height: 101dvh
    }

    .decor {
      overflow: hidden
    }

    .decor img {
      position: absolute;
      z-index: 1
    }

    .decor #textHor,
    .decor #textVert {
      width: 100dvw;
      bottom: 0;
      background-color: #00000080;
      z-index: 5555
    }

    .decor #rightChicken,

    .overlay {

      position: relative;
      z-index: 0;
      background-color: #000000b3;
      -webkit-backdrop-filter: blur(5px);
      backdrop-filter: blur(5px);
      transition: opacity .3s;
      opacity: 0

    .overlay.show {

      left: 50%;

      transform: translate(-550%, -200%);
      z-index: 2;
      transition: all .3s
    }

    .overlay #finalBtn.show {
      transform: translate(-50%, -50%)
    }

    .overlay .decorRight {

    #finger.hide {

      display: none
    }

    }

    }

      transition: opacity .5s;

    }
